import { Grid, Grid2, Typography } from '@mui/material'
import React from 'react'


const Header = () => {
  return (
    <Grid2 container spacing={2}>
      <Grid2 item xs={12} sm={12}>
        <Typography variant='h4'>ポートフォリオ</Typography>
      </Grid2>
    </Grid2>
  )
}

export default Header
